import React, { Component } from "react";
import { Button } from "semantic-ui-react";
import Layout from "../../components/Layout";

class MailList extends Component {
  render() {
    return (
      <Layout>
        <div>
          <Button type="submit" basic color="violet">
            택배 접수
          </Button>
        </div>
      </Layout>
    );
  }
}

export default MailList;
